<script lang="ts">
  import { onMount } from "svelte";
  import gsap from "gsap";
  import { theme } from "$lib/stores";

  function animate() {
    const guides = document.querySelectorAll("[id*=guides]");
    const shadows = document.querySelectorAll("[id*=shadow]");
    const bgs = document.querySelectorAll("[id*=bg]");
    gsap.fromTo(
      [guides],
      { opacity: 1 },
      { opacity: 0, duration: 4, yoyoEase: "rough" }
    );
    gsap.fromTo(
      [bgs],
      { opacity: 0 },
      { opacity: 1, duration: 4, yoyoEase: "rough" }
    );
    gsap.fromTo(
      [shadows],
      { opacity: 0 },
      { opacity: 0.4, duration: 4, yoyoEase: "power3.inOut" }
    );
    gsap.fromTo(
      ["#screen"],
      {
        y: -10,
        rotate: 0,
      },
      { y: 0, repeat: 1, rotate: 10, yoyoEase: "circ", duration: 2 }
    );
    gsap.fromTo(
      ["#battery"],
      {
        x: 30,
        y: -60,
        rotate: 0,
      },
      { x: -100, y: -80, repeat: 1, rotate: 10, yoyoEase: "circ", duration: 2 }
    );
    gsap.fromTo(
      ["#blueprint-shadow"],
      {
        scale: 0.7,
        y: 80,
        x: 100,
      },
      {
        scale: 1,
        x: 0,
        y: 0,
        repeat: 0,
        rotate: 0,
        yoyoEase: "power4",
        duration: 4,
      }
    );
    gsap.fromTo(
      ["#chip"],
      {
        y: -40,
        x: -40,
        rotate: 0,
      },
      { x: 140, y: 0, repeat: 1, rotate: -30, yoyoEase: "expo", duration: 2 }
    );
    gsap.fromTo(
      ["#case"],
      {
        y: -30,
        rotate: 0,
      },
      { x: 0, y: 0, repeat: 1, rotate: -20, yoyoEase: "expo", duration: 2 }
    );
  }
  onMount(() => {
    if ($theme === "dark") {
      const shadows = document.querySelectorAll("[id*=shadow]");
      shadows.forEach((shadow) => {
        (shadow as SVGElement).style.opacity = "0.2";
        (shadow as SVGElement).style.mixBlendMode = "darken";
      });
    }
    const guides = document.querySelectorAll("[id*=guides]");
    guides.forEach((guide) => ((guide as SVGElement).style.opacity = "0"));
    gsap.fromTo(
      ["#screen"],
      {
        y: -10,
      },
      { y: 30, repeat: -1, yoyoEase: "slow", duration: 8 }
    );
    gsap.fromTo(
      ["#battery"],
      {
        x: 30,
        y: -60,
      },
      { x: 0, y: 0, repeat: -1, yoyoEase: "slow", duration: 8 }
    );
    gsap.fromTo(
      ["#blueprint-shadow"],
      {
        scale: 0.7,
        y: 80,
        x: 100,
      },
      { scale: 1, x: 0, y: 0, repeat: -1, yoyoEase: "slow", duration: 8 }
    );
    gsap.fromTo(
      ["#chip"],
      {
        y: -40,
        x: -40,
      },
      { x: 0, y: 0, repeat: -1, yoyoEase: "slow", duration: 8 }
    );
    gsap.fromTo(
      ["#case"],
      {
        y: -30,
      },
      { x: 0, y: 0, repeat: -1, yoyoEase: "slow", duration: 8 }
    );
    gsap.fromTo(
      ["#battery"],
      {
        x: 30,
        y: -60,
      },
      { x: 0, y: 0, repeat: -1, yoyoEase: "slow", duration: 8 }
    );
  });
</script>

